WebBundle\Entity\Room:
    room_1:
        city: '@city_2'
        currency: '@currency_2'
        apiKey (unique): <uuid()>
        titleRu: "ПРОЕКТ: GENESIS"
        titleEn: "PROJECT: GENESIS"
        titleDe: "PROJEKT: GENESIS"
        descriptionRu: "<p>Исследуйте заброшенную военную лабораторию после мировой катастрофы. Обнаружьте все ее загадки, тайники и механизмы. Только так вы сможете выбраться из ловушки и возродить человечество.</p><p>Обращаем ваше внимание, что посещение данной комнаты запрещено людям с кардиостимуляторами и другими приборами для поддержания и обеспечения жизнедеятельности.</p>"
        descriptionEn: "<p>Explore an abandoned military laboratory after a world catastrophe. Discover all of its riddles, hiding places and mechanisms. Only in this way you can get out of the trap and revive humanity.</p><p>Please note that this room is not allowed to people with pacemakers and other devices to maintain and maintain life.</p>"
        descriptionDe: "<p>Entdecken Sie ein verlassenes Militärlabor nach einer Weltkatastrophe . Entdecken Sie alle seine Rätsel, Verstecke und Mechanismen. Nur auf diese Weise können Sie aus der Falle zu bekommen und die Menschheit wieder zu beleben.</p><p>Bitte beachten Sie, dass dieses Zimmer nicht für Menschen mit Herzschrittmachern und anderen Geräten erlaubt ist, aufrecht zu erhalten und Leben.</p>"
        coordinates: 48.194907,16.333932
        addressRu: "Zwölfergasse 9,1150"
        addressEn: "Zwölfergasse 9,1150"
        addressDe: "Zwölfergasse 9,1150"
        phone: "+38 (098) 000 80 77"
        email: "genesis@genesis.com"
        difficulty: 7
        roomManagers: ['@user_1']
        timeMax: 60
        playersMin: 2
        playersMax: 4
        ageMin: 14
        enabled: true
        logo: "genesis_logo.png"
        thumbnail: "genesis_thumbnail.jpg"
        slides: ["genesis_slide_1.jpg","genesis_slide_2.jpg","genesis_slide_3.jpg"]
    room_2:
        city: '@city_2'
        currency: '@currency_2'
        apiKey (unique): <uuid()>
        titleRu: "НЕ ПОЙМАН - НЕ ВОР"
        titleEn: "NOT CAUGHT, NOT A THIEF"
        titleDe: "NICHT GEKAUFT, NICHT EINE THIEF"
        descriptionRu: "<p>Команда грабителей, которые тщательно продумывают каждое свое дело и просчитывают всё до мелочей, получает заказ от человека, у которого есть компромат на них.</p><p>Ограбление века, взамен на свободу. Ведь нужно украсть, не просто деньги. Для этого дела они разрабатывают сложную и многоходовую комбинацию идеального ограбления.</p>"
        descriptionEn: "<p>A team of robbers who carefully think through each of their business and calculate all the details, receives an order from a person who has dirt on them.</p><p>The robbery of the century, in exchange for freedom. After all, you need to steal, not just money. For this case, they are developing a complex and multi-way combination of ideal robbery.</p>"
        descriptionDe: "<p>Team Räuber, die durch jedes seiner Geschäfts sorgfältig denken und alles bis ins letzte Detail berechnen, erhält einen Auftrag von einem Mann, der Schmutz auf sie hat.</p><p>Raub des Jahrhunderts, im Austausch für die Freiheit. Schließlich müssen Sie nicht nur Geld stehlen. Für diesen Fall entwickeln sie eine komplexe und Multipass -Kombination der perfekte Raub.</p>"
        coordinates: 50.4396532,30.5222597
        addressRu: "ул. Шота Руставели 3"
        addressEn: "Shota Rustaveli st. 3"
        addressDe: "Shota Rustaveli st. 3"
        phone: "+38 (098) 000 80 77"
        email: "thief@thrief.com"
        difficulty: 9
        roomManagers: ['@user_1']
        timeMax: 90
        playersMin: 2
        playersMax: 5
        ageMin: 14
        enabled: true
        logo: "thief_logo.png"
        thumbnail: "thief_1.jpg"
        slides: ["thief_1.jpg","thief_2.jpg"]

